    function buildProp(prProp, chProp) {
      try {
        var childLayer = eval(chProp);
      } catch (e) {
        return !!alert(
          "Layer\n" +
            chProp +
            "\n" +
            "doesn\'t exist. Make sure that your composition has the same file structure.",
        );
      }
      for (var p = prProp.propertyDepth - 1; p >= 1; p--) {
        var parPr = prProp.propertyGroup(p);
        try {
          var chLayerObj = eval(chProp);
        } catch (e) {
          return !!alert(
            "Ooops, something went wrong with experimental function.\nPlease, contact script author. Thanks in advance!",
          );
        }
        if (parPr.matchName == "ADBE Vector Group") {
          var charCompNm = prProp
            .propertyGroup(prProp.propertyDepth)
            .containingComp.name.substring(0, 1);
          if (
            parPr.name.substring(0, 1) == charCompNm ||
            parPr.name.substring(0, 2) == charCompNm + " "
          ) {
            if (parPr.name.indexOf(" ") != -1) {
              tmpGrpNm =
                childLayer.containingComp.name.substring(0, 1) +
                parPr.name.substring(1, parPr.name.length);
            } else {
              tmpGrpNm = childLayer.containingComp.name.substring(0, 1);
            }
          } else {
            tmpGrpNm = parPr.name;
          }
          tmpGrpNm = tmpGrpNm.replace(/\\/g, "\\\\");
          tmpGrpNm = tmpGrpNm.replace(/\"/g, '\\"');
          chProp += '("' + tmpGrpNm + '")';
          if (Object.isValid(eval(chProp))) {
            if (p == 1) {
              return true;
            }
          } else {
            try {
              var shGrp = chLayerObj.addProperty(parPr.matchName);
              shGrp.name = tmpGrpNm;
              shGrp.moveTo(parPr.propertyIndex);
              if (p == 1) {
                return true;
              }
            } catch (e) {
              e.toString() + "\n" + e.line;
              return false;
            }
          }
        } else if (parPr.matchName == "ADBE Vectors Group") {
          chProp += '("' + parPr.name + '")';
        } else {
          chProp += '("' + parPr.name + '")';
          if (Object.isValid(eval(chProp))) {
            if (p == 1) {
              return true;
            }
          } else {
            try {
              var shGrp = chLayerObj.addProperty(parPr.matchName);
              shGrp.name = parPr.name;
              try {
                var setIdx =
                  parPr.parentProperty.numProperties - parPr.propertyIndex;
                shGrp.moveTo(shGrp.parentProperty.numProperties - setIdx);
              } catch (e) {
                shGrp.moveTo(parPr.propertyIndex);
                $.write(er.toString() + "\n");
              }
              if (p == 1) {
                return true;
              }
            } catch (e) {
              return !!alert(e.toString() + "\n" + e.line);
            }
          }
        }
      }
      return false;
    }
    function propsetValues(parProp, childProp) {
      try {
        childProp.setValue(parProp.value);
      } catch (e) {}
      if (childProp.canSetExpression) {
        childProp.expression = parProp.expression;
      }
      removeKeyframes(childProp);
      if (parProp.isTimeVarying && parProp.numKeys > 0) {
        for (var kf = 1; kf <= parProp.numKeys; kf += 1) {
          childProp.setValueAtTime(parProp.keyTime(kf), parProp.keyValue(kf));
          childProp.setTemporalEaseAtKey(
            kf,
            parProp.keyInTemporalEase(kf),
            parProp.keyOutTemporalEase(kf),
          );
        }
      }
    }
    function prop2String(currComp, activeProperty, fullNames, matchNames) {
      var currProp = activeProperty;
      var propStr = "";
      while (currProp.parentProperty != null) {
        if (
          currProp.parentProperty.propertyType == PropertyType.INDEXED_GROUP &&
          fullNames != true
        ) {
          name = currProp.propertyIndex;
        } else if (
          currProp.matchName == "ADBE Root Vectors Group" ||
          currProp.matchName == "ADBE Effect Parade" ||
          currProp.matchName == "ADBE Layer Styles" ||
          currProp.matchName == "ADBE Mask Parade"
        ) {
          name = '"' + currProp.matchName + '"';
        } else if (currProp.name == currComp.name) {
          name = '"CharNameReplace"';
        } else {
          matchNames || propStr == ""
            ? (name = '"' + currProp.matchName + '"')
            : (name = '"' + currProp.name + '"');
        }
        propStr = "(" + name + ")" + propStr;
        currProp = currProp.parentProperty;
      }
      return propStr;
    }
